import React from "react"
import PropTypes from "prop-types"

function handleClick(){
  console.log("Button was clicked")
}
const json = require('./overview.json');
let rows = []

const SubEvent = (props)  => {
  for (let i = 0; i < json['slider_elements'].length; i++) {
    rows.push(<div key={json['slider_elements'][i]['id']  } > <h3> {json['slider_elements'][i]['desc']} </h3>
      <a href={"/sport/" + json['slider_elements'][i]['id']} 
      className='goToEvents' onClick={() => {handleClick}}> events </a>
     </div>);
  }
  return rows
}


class Sports extends React.Component {
  reqListener(e) {
    console.log(json['slider_elements'][0]);
  } 
  render () {
    return (
      <React.Fragment>
        <h1>Sports </h1>
        <div> <SubEvent display={true} /> </div>

      </React.Fragment>
    );
  }
}

export default Sports
